description:
3:0 System. The program of complex statistical data processing for sports competitions. Input 8 FPS Case.

 The program «3:0 System» is intended to provide complex statistical processing information on moving objects on an observable scene.
 The current version of the program is operable to provide the following information:
 • Average speed of the player during his stay on arena;
 • The maximal speed of the player during his stay on arena;
 • The general distance the player passed during his stay on arena;
 • Time of the player stay on arena;
 • Run distance and speed of the player for defined time
 • Qualitative and quantitative estimation of frequency of the player stay in various sites of arena;
 • Distance from any point on arena to a gate;
 • Distance between any two points.
 The program is resistant against the majority of artifacts on an observable arena, such as: change of light exposure brightness (clouds, illumination on/off), camera vibrations, hardware noise, atmospheric precipitations, etc. Unlike other similar systems, the present program «3:0 System» can operable using only one video camera. Essential requirements to a video camera are its stability (immovability) and coverage by a video camera of all the zone of interest (all the arena).
 The program is functioning in semiautomatic mode. 
 Workloading of the operator is the higher the more objects (players) are traced and more complicated is their behaviour by crossings and interactions with each other.
 The system is able to function both with a video camera (in a real-time mode) and with preliminary recorded videos with an opportunity of their detailed analysis. The interface of the program is convenient for management, as all the basic operations are performed in one window by means of one click of the mouse.
 The proposed embodiments:
 • TV:
 • Work on the live broadcast for online data assessing acquisition the statistical information (the distance passed by the player, the maximal and average speed, speed of counterattack, distance to a gate at penalty kick, etc.);
 • Aftergame analysis (detailed analysis of players actions in various episodes: distances, speeds, a finding staying of players on the certain sites of arena);
 • Training process: measurement of speed performance and distance control parameters of players.
 «3:0 System» is a constantly developing product. The new technical features and functional options are added to the program continuously, which can be expanded according to your demands.
